【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 圧倒的な歯垢除去力により、質の高いオーラルケアを実現！<br />上下振動数20000回/分、左右反転数約8800回/分とブラウン独自の3D丸型回転により高い歯垢除去力を実現します。<br /><br />★ 押し付けすぎを防いで、歯と歯ぐきに優しい。<br />押し付けすぎると、自動で上下運動をストップします。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 本体サイズ 幅×高さ×奥行き： 約110×253×55mm<br />* 本体重量： 約0.35kg<br />* パッケージサイズ 幅×高さ×奥行き： 約233×271×180mm<br />* 最大振動数： 上下振動数約20000回/分、左右反転数約8800回/分<br />* 使用電池： ニッケル水素電池 約7日間（1日2回、各2分間使用の場合）<br />* モード数： 1モード<br />* 掲載モード名： クリーン<br />* 押し付け防止機能： 過圧ストッパー（押付け過ぎた際、上下振動を自動的にストップ）<br />* 付属ブラシ名： マルチアクションブラシ（EB50）、ステインケアブラシ（EB18）<br />* 本体生産国： ドイツ<br />* 付属品： 取扱説明書、充電器、替ブラシ2本</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
